import { Content } from 'antd/lib/layout/layout';
import React from 'react';

const PostCard = () => {
  return (
    <div>
      <Card>
        <Image />
        <Content />
        <Buttons></Buttons>
      </Card>
    </div>
  );
};

export default PostCard;
